import PagesButtons from "./PagesButtons";
import PagesPlaces from "./PagesPlaces";

function Pages() {
    return (
      
        <div className="row mt-2">
            <div className="col col-md-auto"> 
                <div className="row button-page">
                    <PagesButtons/>
                </div>
           </div>
           <div className="co; col-md-auto"> 
                <div className="row place-page">
                    <PagesPlaces/>
                </div>
           </div>

           <div className="col col-md-auto ml-2">
                <div className="row name-page">

                </div>
                <div className="row recipe-page">

                </div>
           </div>
        </div>
      
    );
  }
  
export default Pages;
